"use strict";var vm=new Vue({el:"#IotDeviceLog",data:function(){return{cloak:!0,refreshLoading:!1,IotDeviceLogDetail:[]}},created:function(){this.fetch()},methods:{fetch:function(){var e=this;axios.get("/api/v1/admin/iot/devices/log").then(function(t){e.IotDeviceLogDetail=t.data.data,e.IotDeviceLogDetail.forEach(function(e,t,o){switch(o[t].loggedAt=new Date(o[t].loggedAt).Format("yyyy-MM-dd hh:mm:ss"),o[t].type){case"inbound":o[t].type="I";break;case"outbound":o[t].type="O"}})}).catch(function(e){console.log(e)})},refresh:function(){var e=this;this.refreshLoading=!0,setTimeout(function(){e.refreshLoading=!1,e.fetch()},1e3)}}});